import React from 'react';
import ReactDOM from 'react-dom';

function MyApp(){
    return (
        <div>
        <ul>
            <li>Item 1</li>
            <li>Item 2</li>
            <li>Item 3</li>
        </ul>
        <ul>
            <li>Item 4</li>
            <li>Item 5</li>
            <li>Item 6</li>
        </ul>
        </div>
    )
}

ReactDOM.render(<MyApp />, document.getElementById('root'));
